import { container } from "assets/jss/material-kit-react.js";
import image from "assets/img/sign.jpg";

const carouselStyle = {
  section: {
    paddingBottom: "100px",
    overflow: "hidden",
    backgroundImage: "url(" + image + ")"
  },
  container,
  marginAuto: {
    marginLeft: "auto !important",
    marginRight: "auto !important"
  },
  recenter: {
    marginLeft: "25vw",
  }
};

export default carouselStyle;
